bool outOfCriticalRegion(pair<pair<pair<int, int>, pair<int, int> >, float> obs)
{
    int minpix_x = obs.first.first.first;
    int minpix_y = obs.first.first.second;
    int maxpix_x = obs.first.second.first;
    int maxpix_y = obs.first.second.second;
    float z_depth = obs.second;

    if (maxpix_x < 128 - delta || minpix_x > 128 + delta || maxpix_y < 128 - delta || minpix_y > 128 + delta)
    {
        return true;
    }

    return false;
}

bool isSafe(int row, int col, vector<vector<bool> >& visited)
{
    return (row >= 0 && row < 256) &&
        (col >= 0 && col < 256) &&
        (arr[row][col] < threshold &&
            !visited[row][col]);
}



void DFS(int row, int col, vector<pair<int, int> >& list, vector<vector<bool> >& visited)
{
    // These arrays are used to get row and column
    // numbers of 4 neighbours of a given cell
    int rowNbr[] = { -1, 1, 0, 0 };
    int colNbr[] = { 0, 0, 1, -1 };
    queue<pair<int, int> > queue;

    // Mark this cell as visited
    visited[row][col] = true;
    pair<int, int> pair(row, col);
    queue.push(pair);

    while (!queue.empty())
    {
        pair = queue.front();
        queue.pop();
        list.push_back(pair);
        for (int k = 0; k < 4; ++k)
        {
            if (isSafe(pair.first + rowNbr[k], pair.second + colNbr[k], visited))
            {
                queue.push(make_pair(pair.first + rowNbr[k], pair.second + colNbr[k]));
                visited[pair.first + rowNbr[k]][pair.second + colNbr[k]] = true;
            }
        }
    }

}




pair<vector<vector<pair<int, int> > >, vector<vector<pair<int, int> > > > connectedComponents() {
    int connectedComp = 0;
    vector<vector<bool> > visited(256, vector<bool>(256, false));
    vector<vector<pair<int, int> > > components;

    for (int j = 0; j < 256; j+=5)
    {
        for (int i = 0; i < 256; i+=5)
        {
            if (!visited[i][j] && arr[i][j] < threshold)
            {
                vector<pair<int, int> > list;
                clock_t start1,netstart1;
                start1 = clock();
                DFS(i, j, list, visited);
                netstart1 = clock();
                double et = double(netstart1-start1)/double(CLOCKS_PER_SEC);
                cout << "object detection " <<fixed <<et<<std::setprecision(10)<< endl;
                if (list.size() > pixelcountThreshold)
                {
                    components.push_back(list);
                    connectedComp++;
                }
            }
        }
    }

    vector<vector<pair<int, int> > > drones;
    vector<vector<pair<int, int> > > obstacles;
    for (int i = 0; i < components.size(); i++)
    {
        if (components[i].size() > 5000)
        {
            obstacles.push_back(components[i]);
        }
        else
        {
            drones.push_back(components[i]);
        }
    }

    pair<vector<vector<pair<int, int> > >, vector<vector<pair<int, int> > > > t(drones, obstacles);
    return t;
}


